import React from 'react';
import { Link } from 'react-router-dom';

import pdf1 from './DIODES.pdf';

import Pdf_reader from './Pdf_reader';

class Notes extends React.Component {
	constructor(props) {
		super(props);
		this.state = {
			pdf: undefined,
			isPDFShowing: false,
		};
	}

	onNotesClick = pdfName => {
		this.setState({ pdf: pdfName, isPDFShowing: !isPDFShowing });
	};

	render() {
		return (
			<div>
				<h1>Class notes 1</h1>
				<button onClick={() => this.onNotesClick(pdf1)}>Notes 1</button>
				<button onClick={() => this.onNotesClick(pdf1)}>Notes 2</button>
				{this.state.isPDFshowing && <Pdf_reader note={this.state.pdf} />}
			</div>
		);
	}
}

export default Notes;
